DROP TABLE IF EXISTS champions;
CREATE TABLE champions(
   champion_name           VARCHAR(20) NOT NULL PRIMARY KEY
  ,champion_title          VARCHAR(30) NOT NULL
  ,class                   VARCHAR(15) NOT NULL
  ,playstyle               VARCHAR(15) NOT NULL
  ,date_release            VARCHAR(15)  NOT NULL
  ,last_change             VARCHAR(10) NOT NULL
  ,blue_essence_price      INTEGER  NOT NULL
  ,rp_price                INTEGER  NOT NULL
  ,resource_type           VARCHAR(15)
  ,health                  NUMERIC(5,1) NOT NULL
  ,health_growth           INTEGER  NOT NULL
  ,health_lvl18            NUMERIC(6,1) NOT NULL
  ,health_regen            NUMERIC(4,2) NOT NULL
  ,health_regen_growth     NUMERIC(4,2) NOT NULL
  ,health_regen_lvl18      NUMERIC(5,2) NOT NULL
  ,mana                    NUMERIC(6,2) NOT NULL
  ,mana_growth             NUMERIC(4,1) NOT NULL
  ,mana_lvl18              NUMERIC(7,2)
  ,mana_regen              NUMERIC(5,2) NOT NULL
  ,mana_regen_growth       NUMERIC(4,2) NOT NULL
  ,mana_regen_lvl18        NUMERIC(5,2)
  ,attack_damage           NUMERIC(5,2) NOT NULL
  ,attack_damage_growth    NUMERIC(9,7) NOT NULL
  ,attack_damage_lvl18     NUMERIC(11,7) NOT NULL
  ,attack_speed            NUMERIC(5,3) NOT NULL
  ,attack_speed_growth     VARCHAR(5) NOT NULL
  ,attack_speed_lvl18      NUMERIC(5,3) NOT NULL
  ,armour                  NUMERIC(4,1) NOT NULL
  ,armour_growth           NUMERIC(4,2) NOT NULL
  ,armour_lvl18            NUMERIC(6,2) NOT NULL
  ,magic_resistance        NUMERIC(4,1) NOT NULL
  ,magic_resistance_growth NUMERIC(4,2) NOT NULL
  ,magic_resistance_lvl18  NUMERIC(5,2) NOT NULL
  ,movement_speed          INTEGER  NOT NULL
  ,movement_speed_lvl18    INTEGER  NOT NULL
  ,attack_range            INTEGER  NOT NULL
  ,attack_range_lvl18      INTEGER  NOT NULL
);
